@notice Initialize a Proxy contract and sets the address of the administrative
@dev Requirements:
@dev - The Proxy contract have not been initialized before
@dev Emits an {Initialized} event

@notice Claim an NFT (Assisted)
@dev Requirements:
@dev - The function initiator must have the claim role
@dev - {nft} must be supported by this contract
@dev - {tokenId} must be owned by this contract
@dev - {recipient} cannot be zero address
@dev - {recipient} must have the {IERC721ReceiverUpgradeable} interface if it is a smart contract
@dev Emits a {Transfer} and {Claim} event
@param nft The NFT contract address
@param tokenId The token id of the NFT
@param recipient The wallet address of the recipient

@notice Manage a NFT collection
@dev Requirements:
@dev - The function initiator must have the default admin role
@dev - {nft} must not be zero address
@dev Emits a {CollectionAdded}, {CollectionRemoved} or {CollectionAmended} event
@param name The NFT collection name
@param nft The NFT collection contract address
@param supported Indicate if the NFT collection is supported

@dev Add a new NFT collection
@dev Emits a {CollectionAdded} event
@param name The NFT collection name
@param nft The NFT collection contract address

@dev Amend an existing NFT collection
@dev If `supported`, will perform an amendment. Otherwise, will perform a deletion.
Emits a {CollectionRemoved} or {CollectionAmended} event
@param name The NFT collection name
@param nft The NFT collection contract address
@param supported Indicate if the NFT collection is supported

@notice Enables receiving of NFTs
@dev Interface that is necessary to receive asset via {safeTransfer} from ERC721 asset contract.
Reverts if ERC721 asset contract is not supported by this contract
@inheritdoc IERC721ReceiverUpgradeable
@return {onERC721Received.selector} bytes4 representation, 0x150b7a02
